criteria:
Inclusion Criteria:

  -  Idiopathic Parkinson's Disease (PD) diagnosed between the ages of 30 and 85 years;

  -  Hoehn and Yahr Stage 1-3 in an "on" state;

  -  Require levodopa-containing medication regimen at least 3 times during the waking day;

  -  Experience motor fluctuations with a minimum of 2 hours of average daily "off" time
     per waking day (excluding early morning "off" time) and demonstrate levodopa
     responsiveness;

  -  Are on stable PD medication regimen;

  -  Total daily LD dose <1600 mg/day;

  -  Able to perform a spirometry maneuver in the ON and OFF states;

  -  Normal cognition confirmed by MMSE score ≥25

Exclusion Criteria:

  -  Pregnant or lactating females;

  -  Previous surgery for PD or plan to have stereotactic surgery during the study period;

  -  History of psychotic symptoms requiring treatment, or suicide ideation or attempt
     within last year;

  -  Known contraindication to the use of levodopa;

  -  Any significant condition, severe concurrent disease, abnormality or finding that
     would make patients unsuitable or may compromise patient safety;

  -  Any contraindication to performing routine spirometry.

Inclusion Criteria:

  -  HIV-1-infected patients with no previous AIDS event (excluding a healed tuberculosis);

  -  Current antiretroviral treatment associating dolutegravir + abacavir + lamivudine for
     at least 1 month;

  -  Nadir CD4 ≥ 100/mm3;

  -  Plasma RNA viral load < 50 copies/ml for at least 12 months;

  -  Plasma RNA viral load <20 or 40 copies/ml (according to the threshold of the method
     used by local laboratory) at the screening visit;

  -  No documented virologic failure or known resistance to any integrase inhibitor,

  -  Patient having provided a written consent;

  -  Patients follow-up possible in ambulatory;

  -  Patient age > 18 years;

  -  Covered by health insurance

Exclusion Criteria:

  -  Non-compliant patient

       -  Subject is pregnant, or lactating, or of childbearing potential and without
          contraception;

       -  Active opportunistic infections (defining AIDS);

       -  Known hypersensibility to abacavir or lamivudine or dolutegravir;

       -  Patients harboring HLA B*5701;

       -  Major overweight (BMI ≥ 40);

       -  Weight <40 kg;

       -  Creatinine clearance < 50ml/min;

       -  Cirrhosis or severe liver failure (factor V < 50%);

       -  Life Prognosis threatened within 6 months;

       -  Circumstances that may impair judgment or understanding of the information given
          to the patient;

       -  Co-medication with carbamazepin, oxcarbamazepin, fosphenytoïn, phenobarbital,
          phenytoïn, primidon, St John's wort or dofetilid;

       -  Malabsorption syndromes;

       -  The following laboratory criteria:

            -  Serum AST,ALT > 5 x upper limit of normal (ULN)

            -  Thrombocytopenia with platelet count < 50.000/ml

            -  Anemia with hemoglobin < 8g/dl

            -  Polynuclear neutrophil count < 500/mm3

Inclusion Criteria:

  -  Be at least 18 years of age;

  -  Provide written informed consent;

  -  Have a subject reported history of dry eye for at least 6 months

  -  Have a history of use or desire to use eye drops for dry eye symptoms within 6 months

  -  Have a Schirmer's Test score of ≤10mm and ≥1mm

  -  Have a Tear Film Break-Up Time (TFBUT) ≤10 seconds

  -  Have a corneal fluorescein staining score of ≥2 in at least one region of the cornea

Exclusion Criteria:

  -  Have any clinically significant slit-lamp findings at Visit 1 that may include active
     blepharitis, meibomian gland dysfunction (MGD), lid margin inflammation or active
     ocular allergies that require therapeutic treatment, and/or in the opinion of the
     investigator may interfere with study parameters;

  -  Be diagnosed with an ongoing ocular infection (bacterial, viral, or fungal), or active
     ocular inflammation at Visit 1;

  -  Have worn contact lenses within 7 days of Visit 1 or anticipate using contact lenses
     during the study;

  -  Have previously had laser-assisted in situ keratomileusis (LASIK) surgery within the
     last 6 months;

  -  Have an IOP > 25 mmHg at Visit 1;

  -  Have any planned ocular and/or lid surgeries over the study period;

  -  Be using or anticipate using temporary punctal plugs during the study that have not
     been stable within 30 days of Visit 1;

  -  Be currently taking any topical ophthalmic prescription (including medications for
     glaucoma) or over-the-counter (OTC) solutions, artificial tears, gels or scrubs, and
     cannot discontinue these medications for the duration of the trial (excluding
     medications allowed for the conduct of the study);

  -  Have corrected visual acuity greater than or equal to logMAR +0.7 as assessed by Early
     Treatment of Diabetic Retinopathy Study (ETDRS) scale in both eyes at Visit 1;

Inclusion Criteria:

  -  Personally submitted written voluntary informed consent to participate in the study

  -  Stable chronic renal disease treated with peritoneal dialysis for at least 16 weeks
     before screening

  -  Intact PTH level of > 240 pg/ml at screening

Exclusion Criteria:

  -  Treatment with cinacalcet hydrochloride within 2 weeks before screening;

  -  Change in dose or dosing regimen of an activated vitamin D drug or its derivative,
     phosphate binder, or calcium preparation within 2 weeks before screening; or start of
     treatment with such drugs within 2 weeks before screening;

  -  Parathyroidectomy and/or parathyroid intervention within 24 weeks before screening;

  -  Severe heart disease;

  -  Severe hepatic dysfunction;

  -  Uncontrolled hypertension and/or diabetes;

  -  Treatment with an investigational product (drug or medical device) in a clinical study
     or any study equivalent to clinical study within 12 weeks before screening;

  -  Primary hyperparathyroidism;

  -  Other conditions unfit for participation in this study at the discretion of the
     investigator or subinvestigator.

Inclusion Criteria:

  -  Personally submitted written voluntary informed consent to participate in the study

  -  Stable chronic renal disease treated with hemodialysis 3 times weekly for at least 12
     weeks before screening

  -  Mean intact PTH level of > 240 pg/ml at screening, at 2 weeks and 1 week before the
     start of study treatment

Exclusion Criteria:

  -  Treatment with cinacalcet hydrochloride within 2 weeks before screening;

  -  Change in dose or dosing regimen of an activated vitamin D drug or its derivative,
     phosphate binder, or calcium preparation within 2 weeks before screening; or start of
     treatment with such drugs within 2 weeks before screening;

  -  Parathyroidectomy and/or parathyroid intervention within 24 weeks before screening;

  -  Severe heart disease;

  -  Severe hepatic dysfunction;

  -  Uncontrolled hypertension and/or diabetes;

  -  Treatment with an investigational product (drug or medical device) in a clinical study
     or any study equivalent to clinical study within 12 weeks before screening;

  -  Primary hyperparathyroidism;

  -  Other conditions unfit for participation in this study at the discretion of the
     investigator or subinvestigator.

Key Inclusion Criteria:

  -  Adult participants diagnosed with either VABP or ventilated HABP requiring IV
     antibiotic therapy;

  -  Intubated and on mechanical ventilation at the time of randomization;

  -  New or progressive infiltrate on chest radiography consistent with pneumonia;

  -  Presence of clinical criteria consistent with a diagnosis of ventilated nosocomial
     pneumonia.

Key Exclusion Criteria:

  -  History of moderate or severe hypersensitivity reactions to beta-lactam antibiotics;

  -  Prior non-study antibiotics for > 24 hours;

  -  Gram stain of lower respiratory tract specimen showing only gram positive bacteria;

  -  Active immunosuppression;

  -  End-stage renal disease or requirement for dialysis;

  -  Expected survival < 72 hours;

  -  Severe confounding respiratory condition (i.e., chest trauma with paradoxical
     respiration);

  -  Known or suspected community-acquired bacterial pneumonia.

  -  Anticipated concomitant use of any of the following medications during the course of
     study therapy: valproic acid or divalproex sodium. Anticipated concomitant use of
     serotonin re-uptake inhibitors, tricyclic antidepressants, or serotonin 5-HT1 receptor
     agonists (triptans), meperidine, or buspirone during the course of linezolid
     treatment.

  -  Receipt of a monoamine oxidase inhibitor within 14 days prior to the first dose of
     study drug or anticipated concomitant use during the course of linezolid therapy.

Inclusion Criteria:

  -  Male or female subjects with age ≥ 18 years or the otherwise legal lower age according
     to the country of residence;

  -  Confirmed acute lower extremity proximal DVT or PE for which long term treatment with
     low molecular weight heparin (LMWH) is indicated;

  -  Cancer, other than basal-cell or squamous-cell carcinoma of the skin;

  -  Able to provide written informed consent.

Exclusion Criteria:

  -  Thrombectomy, insertion of a caval filter, or use of a fibrinolytic agent to treat the
     current (index) episode of DVT and/or PE;

  -  Treatment with therapeutic doses of an anticoagulant other than that used for
     pretreatment of the current (index) VTE episode prior to randomization;

  -  Active bleeding or high risk for bleeding contraindicating treatment with LMWH or
     edoxaban;

  -  Any other contraindication listed in the local labeling of dalteparin, enoxaparin, or
     edoxaban;

Inclusion Criteria:

  -  Male or female patients ≥18 years with acute ischaemic stroke in the anterior
     circulation, who has given written consent for his/her participation to the study.

  -  Remaining neurological deficit that is ≥1 NIHSS points, sufficient to warrant
     treatment with tPA (not taking possible contraindications into account) and is severe
     enough that possible improvement is clearly analysable

  -  Treatment <4½ hours of symptom onset or of waking up in the morning with symptoms

  -  Sufficient bone window for acceptable or better acquisition of flow information with
     ultrasound with TIBI ≤ 4 in the symptomatic artery

  -  In cases with women of Childbearing Capacity (WOCBC): Only if willing to comply with
     effective contraception methods during the course of the trial. Acceptable methods are
     such as oral contraceptives, contraceptive patches, contraceptive implant, vaginal
     contraceptive, double-barrier methods (for example, condom and spermicide),
     intrauterine device (IUD), hormonal IUD

Exclusion Criteria:

  -  Patients with premorbid modified Rankin Scale (mRS) score ≥3;

  -  Patients for whom a complete NIHSS cannot be obtained;

  -  Hemiplegic migraine with no arterial occlusion on baseline Computed Tomography of
     brain (CT);

  -  Seizure at stroke onset and no visible occlusion on baseline CT;

  -  Intracranial haemorrhage on baseline CT;

  -  Clinical presentation suggesting subarachnoid haemorrhage even if baseline CT is
     normal;

  -  Large areas of hypodense ischaemic changes on baseline CT;

  -  Pregnancy or breast-feeding, pericarditis; sepsis; any other serious medical illness
     likely to interact with treatment; confounding pre-existent neurological or
     psychiatric disease; unlikely to complete follow-up; any investigational drug <14
     days;

  -  Inability to provide informed consent sufficiently clearly that the study physician
     can be convinced that informed consent has been given by the patient - such as severe
     aphasia or coma.

Specific sonothrombolysis exclusion criteria

  -  known hypersensitivity/allergy to SonoVue;

  -  recent or unstable coronary ischemia or resting angina <7 days;

  -  acute cardiac insufficiency, cardiac insufficiency class III/IV; serious cardiac
     arrhythmias;

  -  any right-left-shunt; severe pulmonary hypertension; uncontrolled hypertension;

  -  moderate to severe Chronic Obstructive Pulmonary Disease (COPD; baseline O2 saturation
     <80%);

  -  acute respiratory distress syndrome (ARDS);

