criteria:
Inclusion Criteria:

  1. Meet the WHO Diagnostic Criteria for Type 2 Diabetes (published on 1999);

  2. HbA1c≥ 7.5% and ≤ 10.0% after control of diet and exercises;

  3. Male and female,age between 18 and 70 years;

  4. BMI between 18.5-35kg/m2;

  5. Willing to be assigned to any treatment arm and sign inform consent.

Exclusion Criteria:

  1. Type 1 diabetes;

  2. Treated by oral or injective antidiabetic drug before screening, including insulin and
     herb;

  3. Fasting plasma glucose > 13.3 mmol/L (240 mg/dL);

  4. Resistant hypertension [blood pressure above the goal despite adherence to at least 3
     optimally dosed antihypertensive medications (including diuretic) of different
     classes,or blood pressure is controlled to below the goal by at least 4 different
     classes of drugs];

  5. Plasma triglyceride > 500 mg/dL (5.65 mmol/L);

  6. Is treating by fibrates;

  7. History of diabetic ketoacidosis,diabetic hyperglycemic hyperosmolar syndrome,lactic
     acidosis, diabetic hypoglycemia; or is currently combined with retinopathy, diabetic
     nephropathy and diabetic neuropathy;

  8. Had transient ischemic attack,cerebrovascular accident or unstable angina in the past
     6 months;

  9. History of myocardial infarction or had conducted coronary angioplasty or coronary
     artery bypass graft surgery;

 10. Heart failure (NYHA classification Stage III or IV), or left ventricular hypertrophy
     indicated by ECG;

 11. Hepatic diseases such as hepatocirrhosis, active hepatitis,aspartate aminotransferase
     or alanine aminotransferase > 2.5 fold of the upper limit of the normal range;

 12. Kidney diseases or serum creatinine exceed the normal range: male > 133 μmol/L or
     female >108 μmol/L;

 13. Had malignancy in the past 5 years, not including basal cell carcinoma;

 14. Had or is currently receiving treatment that can alter blood glucose metabolism,
     including but not limited to diuretic,hormone (corticotropin or steroids),beta
     blockers;

 15. Have the diseases that can alter blood glucose metabolism, including but not limited
     to active hepatitis, hyperthyroidism,or adrenal tumors;

 16. Edema with unknown reason;

 17. Alcohol or drug addiction;

 18. Had participated other drugs' clinical trials in the 3 months before screening;

 19. Pregnant or lactic women; or women of childbearing age who are not able to or is not
     willing to conduct contraception;

 20. Any condition that make investigator consider the subject is not suitable to
     participate the trial.

Inclusion Criteria:

  -  Signed a current IRB/REB/IEC-approved informed consent form;

  -  Parkinson's disease, per UK Parkinson's Disease Society (UKPDS) Brain Bank Clinical
     Diagnostic Criteria;

  -  On a stable regimen of antiparkinson's medications for at least 30 days prior to
     screening, including a levodopa preparation administered not less than three times
     daily, and willing to continue the same doses and regimens during study participation;

  -  Following diary training, the subject is willing and able to understand and complete
     the 24-hour PD home diary (trained caregiver/study partner assistance allowed);

  -  Any other current and allowed prescription/non-prescription medications and/or
     nutritional supplements taken regularly must have been at a stable dose and regimen
     for at least 30 days prior to screening, and subject must be willing to continue the
     same doses and regimens during study participation (this criterion does not apply to
     medications that are being taken pre-study only on an as-needed basis);

Exclusion Criteria:

  -  History of neurosurgical intervention related to Parkinson's disease (e.g. deep brain
     stimulation);

  -  History of seizures within 2 years prior to screening;

  -  History of stroke or TIA within 2 years prior to screening;

  -  History of cancer within 5 years prior to screening, with the following exceptions:
     adequately treated non-melanomatous skin cancers, localized bladder cancer,
     non-metastatic prostate cancer, in situ cervical cancer, or other definitively treated
     cancer that is considered cured;

  -  Presence of cognitive impairment, as evidenced by a Mini-Mental Status Examination
     (MMSE) score of less than 24 during screening;

  -  If female, is pregnant or lactating;

  -  If a sexually active female, is not surgically sterile or at least 2 years
     post-menopausal, or does not agree to utilize an effective method of contraception
     from screening through at least 4 weeks after the completion of study treatment, using
     one of the following: barrier methods (diaphragm or partner using condoms plus use of
     spermicidal jelly or foam, preferably double-barrier methods); oral or implanted
     hormonal contraceptive; intrauterine device (IUD); or vasectomized male partner;

  -  Treatment with an investigational drug or device within 30 days prior to screening;

  -  Treatment with an investigational biologic within 6 months prior to screening;

  -  Current participation in another clinical trial;

Inclusion criteria:

  -  Written informed consent consistent with International Conference on
     Harmonization-Good Clinical Practice and local laws, signed prior to any study
     procedures being performed (including any required washout);

  -  Male or female patients aged >= 40 years at visit 1;

  -  A clinical diagnosis of IPF within the last 6 years before visit 1, based upon the
     American Thoracic Society/European Respiratory Society/Japanese Respiratory
     Society/Latin American thoracic Association 2011 guideline [P11-07084];

  -  Combination of high-resolution computed tomography (HRCT) pattern, and if available,
     surgical lung biopsy pattern consistent with a diagnosis of IPF as assessed by the
     investigator based on a HRCT scan performed within 18 months of visit 1;

  -  Carbon Monoxide Diffusion Capacity (corrected for Hb) less or equal to 35% predicted
     of normal at visit 1.

Exclusion criteria:

  -  Previous enrolment in this trial;

  -  Alanine Transaminase, Aspartate Transaminase > 1.5 fold upper limit of normal (ULN) at
     visit 1;

  -  Total bilirubin > 1.5 fold ULN at visit 1;

  -  Relevant airways obstruction (i.e. pre-bronchodilator Forced Expiratory Volume in 1
     second/Forced Vital Capacity <0.7 at visit 1)

  -  History of myocardial infarction within 6 months of visit 1 or unstable angina within
     1 month of visit 1

  -  Bleeding Risk:

       -  Known genetic predisposition to bleeding;

       -  Patients who require fibrinolysis, full-dose therapeutic anticoagulation (e.g.
          vitamin K antagonists, direct thrombin inhibitors, heparin, hirudin, etc.) or
          high dose antiplatelet therapy;

       -  History of haemorrhagic central nervous system (CNS) event within 12 months prior
          to visit 1;

       -  History of haemoptysis or haematuria, active gastro-intestinal bleeding or ulcers
          and/or major injury or surgery within 3 months prior to visit 1;

       -  International normalised ratio (INR) > 2 at visit 1;

       -  Prothrombin time (PT) and activated partial thromboplastin time (aPTT) > 150% of
          institutional ULN at visit 1;

  -  Planned major surgery during the trial participation, including lung transplantation,
     major abdominal or major intestinal surgery;

  -  History of thrombotic event (including stroke and transient ischemic attack) within 12
     months of visit 1;

  -  Creatinine clearance < 30 mL/min calculated by Cockcroft-Gault formula at visit 1;

  -  Presence of aortic stenosis (AS) per investigator judgement at visit 1;

  -  Severe chronic heart failure: defined by left ventricular ejection fraction (EF) < 25%
     per investigator judgement at visit 1;

  -  Presence of idiopathic hypertrophic subaortic stenosis (IHSS) per investigator
     judgement at visit 1;

  -  Second-degree or third-degree atrioventricular (AV) block on electrocardiogram (ECG)
     per investigator judgement at visit 1;

  -  Hypotension (systolic blood pressure [SBP] < 100 mm Hg or diastolic blood pressure
     [DBP] < 50 mm Hg) (symptomatic orthostatic hypotension) at visit 1;

  -  Uncontrolled systemic hypertension (SBP > 180 mmHg; or DBP > 100 mmHg) at visit 1;

  -  Known penile deformities or conditions (e.g., sickle cell anemia, multiple myeloma,
     leukemia) that may predispose to priapism;

  -  Retinitis pigmentosa;

  -  History of vision loss;

  -  History of nonarteritic ischemic optic neuropathy;

  -  Veno-occlusive disease;

  -  History of acute IPF exacerbation or respiratory infection within 8 weeks of visit 2.

  -  Treatment with nitrates, n-acetylcysteine, pirfenidone, azathioprine,
     cyclophosphamide, cyclosporine, prednisone >15 mg daily or >30 mg every 2 days OR
     equivalent dose of other oral corticosteroids as well as any investigational drug
     within 4 weeks of visit 2;

  -  Treatment with prostaglandins (e.g., epoprostenol, treprostinil), endothelin-1
     antagonists (e.g., bosentan, sitaxsentan, ambrisentan), phosphodiesterase inhibitors
     (e.g., sildenafil, tadalafil, vardenafil) or a stimulator of guanylatcyclase
     (e.g.,riociguat) within 4 weeks of visit 2;

  -  Treatment with potent cytochrome CYP3A4 inhibitors such as ketoconazole, itraconazole
     and ritonavir within 4 weeks of visit 2;

  -  Supplementation with L-arginine and concurrent use of grapefruit juice or St John's
     wort within 4 weeks of visit 2;

  -  Treatment with the reduced dose of nintedanib (100 mg bid) within 4 weeks of visit 2;
     27. Permanent discontinuation of nintedanib in the past due to adverse events
     considered drug-related;

  -  Known hypersensitivity or intolerance to nintedanib, sildenafil, galactose, peanut or
     soya or any other components of the study medication;

  -  A disease or condition which in the opinion of the investigator may interfere with
     testing procedures or put the patient at risk when participating in this trial;

  -  Alcohol or drug abuse which in the opinion of the treating physician would interfere
     with treatment;

  -  Further exclusion criteria apply.

