  -  Histologically proven esophageal squamous cell carcinoma;

  -  18 ≤ age ≤ 70;

  -  ECOG 0-2;

  -  Previously Treated with platinum or paclitaxel based regimen;

  -  Uni-dimensionally measurable disease (CT or MRI as per RECIST);

