  -  Male patients older than 18 years ;

  -  Histologically confirmed adenocarcinoma of the prostate ;

  -  Continued androgen deprivation therapy either by LHRH agonists/antagonists or
     orchidectomy ;

  -  Serum testosterone <0.50 ng/ml (1.7 nmol/L) ;

  -  Progressive disease (PSA progression or radiological progression or clinical
     progression) ;

  -  ECOG 0-2 ;

  -  Information delivered to patient and informed consent form signed by the patient or
     his legal representative ;

  -  Adequate organ or bone marrow function as evidenced by:

       -  Hemoglobin >/= 10 g/dL

       -  Absolute neutrophil count >/=1.5 x 109/L,

       -  Platelet count >/=100 x 109/L,

       -  AST/SGOT and/or ALT/SGPT </=1.5 x ULN;

       -  Total bilirubin </=1.5 x ULN,

       -  Serum creatinine </=1.5 x ULN. If creatinine 1.0 - 1.5 xULN, creatinine clearance
          will be calculated according to CKD-EPI formula and patients with creatinine
          clearance <60 mL/min should be excluded

Exclusion Criteria:

  -  Patients having received an investigational drug and/or prior surgery, radiation,
     chemotherapy, or other anti-cancer therapy within 4 weeks prior enrolment in the
     study, excepted radiotherapy directed to a single bone lesions which is nonacceptable
     if within 2 weeks ;

  -  Prior treatment with Taxotere or Jevtana ;

  -  Pre-existing symptomatic peripheral neuropathy grade > 2 (CTCAE V4) ;

  -  Uncontrolled cardiac arrhythmias, angina pectoris, and/or hypertension. History of
     congestive heart failure (NYHA III or IV) or myocardial infarction within last 6
     months is also not allowed ;

  -  History of severe hypersensitivity reaction (grade ≥3) to polysorbate 80 containing
     drugs ;

  -  Uncontrolled severe illness or medical condition (including uncontrolled diabetes
     mellitus), active infection including HIV infection, active Hepatitis B or C infection
     that would preclude participation in the trial ;

  -  Concurrent or planned treatment with strong inhibitors or strong inducers of
     cytochrome P450 3A4/5 (a one week wash-out period is necessary for patients who are
     already on these treatments) ;

Inclusion Criteria:

  1. Age between 18 and 75 years;

  2. Diagnosed with Irritable Bowel Syndrome according to the Rome IV criteria:

     (Recurrent abdominal pain, at least 1 day/week for the last 3 months; Symptom onset at
     least 6 months prior to diagnosis; Associated with two or more of the following:

       1. Pain related to defecation;

       2. Pain associated with a change in frequency of stool;

       3. Pain associated with a change in form (appearance/consistency) of stool

  3. Based on the medical history and previous examination, no other causes for the
     abdominal complaints can be defined. Especially no history of:

       1. Inflammatory Bowel Disease;

       2. Celiac Disease;

       3. Thyroid dysfunction (if not well-regulated). If alarm symptoms (including
          unexplained rectal blood loss or weight loss) are present, a colonoscopy has been
          performed and was negative for other causes.

  4. Women in fertile age (<55 years old) must use contraception or be postmenopausal for
     at least two years.

  5. Average worst abdominal pain score (on 11-point NRS) of > 3, during the two-week
     run-in period.

Exclusion Criteria:

  1. Insufficient fluency of the Dutch language;

  2. Any previous use (also incidental use) of peppermint oil capsules in the last 3 months
     prior to inclusion (the use of peppermint tea, menthol candy etc. is allowed);

  3. The inability to stop regular use of medication affecting the gastro-intestinal system
     (such as Non Steroidal Anti Inflammatory Drugs (NSAID), laxatives, prokinetics,
     opioids, smasmolytics and anti-diarrhoeal drugs). This use should be halted at least 1
     week before enrollment into the run-in period;

       1. The use of 1 antidepressant drug is allowed, providing dosing has been stable for
          > 6 weeks before enrollment;

       2. The use of 1 proton pump inhibitor (PPI) is allowed, providing dosing has been
          stable > 6 weeks before enrollment;

  4. Previous major abdominal surgery or radiotherapy interfering with gastrointestinal
     function:

       1. Uncomplicated appendectomy, cholecystectomy and hysterectomy allowed unless
          within the past 6 months;

       2. Other surgery upon judgment of the principle investigator;

  5. History of liver disease, cholangitis, achlorhydria, gallstones or other diseases of
     the gallbladder/biliary system;

  6. Pregnancy, lactation;

  7. Using drugs of abuse;

  8. Known allergic reaction to peppermint.

Inclusion Criteria:

  1. Patients shall have normal organic function such as liver function, Cardiac function
     and renal function;

  2. male or female age >18 years old;

  3. diagnosis GI cancer with histology;

  4. Chronic neurotoxicity grade is 2 or more

  5. Karnofsky Performance scores should be 80 or more

  6. patients are in oxaliplatin-based chemotherapy courses or no more than 21 days after
     last oxaliplatin usage for patients who will discontinue oxaliplatin usage.

  7. without uncured tumor except GI cancer,

  8. Patients should be expected to live no shorter than 3 months

Exclusion Criteria:

  1. patients who is receiving anti-neurotoxicity treatment;

  2. WBC<4.0×109/L，ANC<1.5×109/L,PLT<100×109/L，Hb<90g/L,TBIL>1.5Limitation;BUN）>1.5Limitati
     on；Cr）>1.5Limitation；ALT or AST>2.5Limitation（without liver metastasis）；ALT or
     AST）>5Limitation（with liver metastasis）;

  3. heart dysfunction;

  4. brain metastasis with symptoms;

  5. peripheral nervous system or central nervous system abnormal including diabetes
     mellitus patients with neuropathy;

  6. in situation of oxaliplatin-based chemotherapy progressed, the next chemotherapy
     regime should not contain agents which will cause neurotoxicity (such as paclitaxel
     and cisplatin)

Inclusion Criteria:

  1. 18 ~ 75 years old, postmenopausal women;

  2. Histological or cytological confirmation of hormone receptor-positive [estrogen
     receptor (ER) positive and progesterone receptors (PgR) positive or negative] breast
     cancer;

  3. Disease progression or recurrence after at least one endocrine therapy (either in
     advanced/metastatic setting or adjuvant setting);

  4. ≤4 prior therapies (either in advanced/metastatic setting or adjuvant setting),
     patients may have received one prior chemotherapy;

  5. The disease condition is inoperable, stage III or stage IV, at least one measurable
     lesion or simple bone metastases with no measurable lesions;

  6. Last prior therapy intervals: (a) if the last treatment was endocrine therapy, the
     interval must ≥ 2 weeks; (b) if the last treatment was chemotherapy therapy, the
     interval must ≥ 4 weeks;

  7. Eastern Cooperative Oncology Group Performance Status: 0~1;

  8. Absolute neutrophil count ≥ 1.5×109 / L, platelet count ≥ 100×109 / L, hemoglobin ≥ 90
     g/L;

  9. Life expectancy ≥ 3 months;

 10. Have signed informed consent.

Exclusion Criteria:

  1. Patients have known central nervous system (CNS) metastases or a history of CNS
     metastases , or with leptomeningeal disease;

  2. Patients with human epidermal growth factor receptor-2 (Her-2) positive;

  3. Patients previously received treatment with exemestane;

  4. Patients received radiotherapy ≤ 4 weeks prior to study entry;

  5. Patients with no measurable lesion (except simple bone metastasis), such as pleural or
     pericardial effusion, ascites, et al;

  6. Patients have uncontrolled or significant cardiovascular disease, including:

       1. Myocardial infarction (< the last 12 months)

       2. Uncontrolled angina (< the last 6 months)

       3. Congestive heart failure (< the last 6 months), or Left Ventricular Ejection
          Fraction (LVEF) < 50% prior to study entry

       4. History of any significant ventricular arrhythmias (e.g., ventricular
          tachycardia, ventricular fibrillation, or TdP)

       5. History of significant QT interval prolongation, or Corrected QT Interval (QTc) >
          450 ms prior to study entry

       6. History of cerebrovascular accident

       7. Symptomatic coronary heart disease requiring treatment with agents

  7. The size of fluid area detected by cardiac ultrasonography in cavum pericardium is
     ≥10mm during diastolic period;

  8. History of organ transplantation;

  9. Patients have not recovered from all clinically relevant toxicities to grade 1 due to
     prior therapies;

 10. Patients have clinical significant gastrointestinal abnormality, e.g., unable to
     swallow, chronic diarrhea, ileus, that would interfere the ingestion,transportation or
     absorption of oral agents;

 11. Active infection [Suffered from active infection of bacteria, virus, fungi,
     mycobacteria, parasites, or other infections (excluding nail bed fungal infections),
     or require intravenous antibiotic therapy, or antiviral therapy, or hospitalization
     due to any significant infection events], or persistent fever within 14 days prior to
     study entry;

 12. Patients had organ surgery < 6 weeks prior to study entry;

 13. Abnormal liver function [total bilirubin > 1.5×upper limit of normal (> 3×upper limit
     of normal in case of Gilbert syndrome); Transaminases (ALT, AST) >2.5×upper limit of
     normal (>5x upper limit of normal patients with liver metastases), abnormal renal
     function (serum creatinine > 1.5×upper limit of normal);

 14. Patients with prior invasive malignancies with the exception of curatively-treated
     basal cell or squamous cell carcinoma of the skin or cervical carcinoma in situ,
     unless received curative treatment and with documented evidence of no recurrence in
     the past five years;

 15. Any mental or cognitive disorder, that would interfere the ability to understand the
     informed consent document or the operation and compliance of study;

 16. Patients are currently enrolled in another investigational drug study, or completed
     within 4 weeks prior to study entry, with the exception of patients only in overall
     survival follow-up;

 17. Any other condition which is inappropriate for the study in the opinion of the
     investigators.

Inclusion Criteria:

  1. Histologically and/or cytologically diagnosed patients with advanced, metastatic
     breast cancer,or lacking standard therapy or being failed to or recurrent after
     standard therapy;

  2. Patients who have previously treated with ≤4 chemotherapeutic regimes;

  3. Patients who have previously treated with an anthracyclin antibiotics and a taxane;

  4. Age 18 -70 years old, ECOG performance status of 0-2; Life expectancy of 3 months or
     more;

  5. Patients with at least 1 measurable target lesion determined by CT within 2 weeks
     prior to enrollment;

  6. Neuropathy <CTC2 degree （NCI CTC4.03）within 4 weeks prior to enrollment;

  7. Basically normal results from routine blood test within 1 week prior to enrollment;

  8. Basically normal liver and renal functions within 1 week prior to enrollment;

  9. No abnormal function for major internal organs, no heart diseases.

Exclusion Criteria:

  1. Received chemotherapy, radiotherapy, therapies with hormones or molecularly targeted
     drugs 4 weeks prior to enrollment, or received other chemotherapies while
     participating in this trial;

  2. Patients with documented hypersensitivity to Cremophor EL, or patients with previous
     taxane treatment related SAE;

  3. Patients of pregnancy or breast feeding;

  4. Patients with previous standard capecitabine treatment ineffective, or patients
     received standard capecitabine treatment effective, but with less than 6 months of
     capecitabine clearance period;

  5. Patients with uncontrolled brain metastasis or bone metastasis, which plan for recent
     surgery or local radiotherapy, or other emergency treatment;

  6. Patients combined with severe and /or uncontrolled medical conditions, including
     severe cardiovascular disease, uncontrolled diabetes and high blood pressure, severe
     infection, severe gastrointestinal ulceration, and patients with incontrollable
     psychiatric history;

  7. Patients with poor compliance;

  8. Patients not fitted for this study determined by the investigators.

Inclusion Criteria:

  -  Men and women of at least 50 years of age;

  -  Patients followed in an ambulatory clinic;

  -  Patients presenting primary OA of the knee according to American College or
     Rheumatology (ACR) criteria;

  -  Patients with OA of radiological stages 2 and 3 according to Kellgren-Lawrence;

  -  Patients with a minimum joint space width ≥ 2 mm in the medial tibio-femoral
     compartment on standing knee X-ray (MRI structural study only);

  -  Patients with knee pain on most days of the month before entering into the study;

  -  Patients with a VAS pain score (0-100 mm) while walking on a flat surface ≥ 40 mm
     (Visit 1 (Screening) and Visit 2 (Inclusion Visits));

  -  Patients with no clinically significant laboratory abnormalities in the judgment of
     the investigator;

  -  Female patients who are postmenopausal with confirmed amenorrhea for at least one year
     before entering this study and those who underwent tubal ligation, oophorectomy or
     hysterectomy must agree to a hormonal (folliculo-stimulating hormone [FSH]) dosage at
     Screening visit ;

  -  Patients agreeing to sign the Informed Consent Form prior to any study-related
     activities after having been clearly informed of its methods and constraints;

  -  Patients not taking part in another clinical study;

  -  Patients agreeing to respect the protocol by attending the visits related to the
     study.

Exclusion Criteria:

Criteria related to individual characteristics of the patient

  -  Patients with secondary knee OA;

  -  Patients with known hypersensitivity to Diacerein or to anthraquinone-containing
     product, hypersensitivity to Celecoxib, who have demonstrated allergic-type reactions
     to sulphonamides, experienced asthma, urticaria or allergic-type reactions after
     taking sulphonamides, aspirin (acetyl salicylic acid [ASA]), lactose, non-steroidal
     anti-inflammatory drugs [NSAIDs], acetaminophen or paracetamol;

  -  Patients with a known history of diarrhoea, more particularly if 65 years of age and
     older;

  -  Patients with active malignancy of any type or history of a malignancy within the last
     five years other than basal cell carcinoma;

  -  Patients with other bone and articular diseases (antecedents and/or current signs)
     such as; chondrocalcinosis, Paget's disease of the ipsilateral limb to the target
     knee, rheumatoid arthritis, aseptic osteonecrosis, gout, septic arthritis, ochronosis,
     acromegaly, haemochromatosis, Wilson's disease, osteochondromatosis, seronegative
     spondylo-arthropathy, mixed connective tissue disease, collagen vascular disease,
     psoriasis, inflammatory bowel disease;

  -  Pain in other parts of the body greater than the knee pain that could interfere with
     the evaluation of the index joint;

  -  Patients with fibromyalgia;

  -  Patients with isolated knee lateral compartment OA defined by joint space loss in the
     lateral compartment only;

  -  Patients with Class IV functional capacity using the American Rheumatism Association
     criteria;

  -  Patients who have had surgery in any lower limb or arthroscopy, aspiration or lavage
     in any lower limb joint within 180 days of the Inclusion Visit (Visit 2);

  -  Patients who have had meniscal surgery on the study knee;

  -  Patients who have undergone total knee replacement in the contralateral knee within
     180 days prior to the Screening Visit (Visit 1);

  -  Patients with co-morbid conditions or joint deformity that restrict knee function;

  -  Patients with a history of heart attack or stroke, or who have had serious diseases of
     the heart such as congestive heart failure (functional classes II-IV of the New York
     Heart Association [NYHA]);

  -  Patients who have significant risk factors for heart attack or stroke will be assessed
     carefully. Risk factors for heart attack and stroke include high blood pressure
     (treated or untreated), high cholesterol, diabetes and smoking. The global risk
     assessment will be assessed using the American Heart Association (AHA) assessment of
     cardiovascular (CV) risk tables. Patients with high risk of CV events, according to
     the tables, will be excluded;

  -  Patients with any significant diseases or conditions, including emotional or
     psychiatric disorders and substance abuse that, in the opinion of the Investigator,
     are likely to alter appreciation of OA symptoms or the patient's ability to complete
     the study;

  -  Patients with a history of any illness that, in the opinion of the Investigator, might
     confound the results of the study or pose additional risk to the patient;

  -  Patients with poorly controlled diabetes mellitus defined as Haemoglobin A1c level
     >8%;

  -  Patients with poorly controlled hypertension (sustained Systolic Blood Pressure of >
     150 mmHg or Diastolic Blood Pressure > 95 mmHg);

  -  Patients with any active acute or chronic infections requiring antimicrobial therapy,
     or serious viral (e.g., hepatitis, herpes zoster, HIV positivity) or fungal
     infections;

  -  Patients with a history of recurrent upper gastrointestinal (UGI) ulceration or active
     inflammatory bowel disease (e.g., Crohn's disease or ulcerative colitis), a
     significant coagulation defect, or any other condition, which in the Investigator's
     opinion might preclude the chronic use of Celecoxib or Diacerein. Patients may, at the
     Investigator's discretion, take a proton pump inhibitor (PPI) or antacids daily as
     required, with a 2 hour period between intake of study medication and intake of PPI or
     antacid;

  -  Patients who have been diagnosed as having or have been treated for esophageal,
     gastric, pyloric channel, or duodenal ulceration within 30 days prior to receiving the
     first dose of study medication;

  -  Patients with chronic liver or kidney disease, as defined by aspartate
     aminotransferase (AST) or alanine aminotransferase (ALT) > 2.0 times the upper limit
     of normal (ULN) or blood urea nitrogen (BUN) or serum creatinine > 2.0 times ULN, at
     the Screening Visit (Visit 1);

  -  Patients who have a history of intolerance to acetaminophen or paracetamol, opioids or
     opioid combinations such that it is felt that an adequate non-anti-inflammatory rescue
     analgesic regimen cannot be safely prescribed;

  -  Patients who have a history of alcohol or substance abuse within the last 3 years;

  -  Patients receiving any investigational drug within 30 days or 5 half-lives (whichever
     is greater) prior to the Inclusion Visit (Visit 2);

  -  Patients who plan surgery during the study;

  -  Female patients who are breastfeeding;

  -  Patients with the impossibility of taking part in the total duration of the study and
     attending the visits;

  -  Patients unable to give an informed consent;

  -  Patients who do not respect the acetaminophen or paracetamol washout period of 48
     hours or the NSAID washout period of 1 week before the Inclusion Visit (Visit 2).

Treatment-Related Exclusion:

  -  Patients using corticosteroids (oral, injectable; exception of intraarticular/soft
     tissue injection at the exclusion of the target knee), indomethacin, therapeutic dose
     of glucosamine, chondroitin sulphate or Diacerein or Avocado-Soybean Unsaponifiables
     (ASU) during the 12 weeks preceding inclusion (intraarticular injections of
     corticosteroids in the contralateral knee is allowed during the study);

  -  Patients using hyaluronic acid (intra-articular target knee) during the 26 weeks
     preceding inclusion;

  -  Patients using natural health products (e.g. capsaicin, boswellia, willow bark), and
     creams and analgesic gels (e.g. camphor and alcohol based gels) during one week
     preceding inclusion;

  -  Patients using natural health products susceptible to increase the risk of bleeding
     (e.g. garlic, dong quai, etc.) during one week preceding inclusion;

  -  Patients receiving radioactive synovectomy (target knee) during the 12 weeks preceding
     inclusion;

  -  Patients who are taking NSAIDs and do not want to stop during the study;

  -  If treatment of osteoporosis (bisphosphonates, selective estrogen receptor modulators
     [SERMS], thyroid-stimulating hormone [TSH]) is necessary, it will have to be
     continued, unmodified, for the entire duration of the study;

  -  Patients who have used compounds containing non-approved agents for arthritis or
     agents claiming to possess disease/structure-modifying properties in the 14 days prior
     to the Inclusion Visit (Visit 2);

  -  Patients who have used medications with matrix metalloproteinase (MMP)-inhibitory
     properties (e.g. tetracycline or structurally related compounds) within 28 days prior
     to the Inclusion Visit (Visit 2);

  -  Patients who require acetaminophen or paracetamol at daily doses > 2000 mg (2g) on a
     regular basis;

  -  Patients who are taking a laxative, lithium carbonate, phenytoin or anticoagulants
     (with the exception of ASA up to a maximum daily dose of 325 mg);

  -  Patients who have received chondrocyte transplants or underwent other type of
     cartilage repair procedures in the target joint;

  -  Patients who use oral or topical coxibs;

  -  Patients who use calcitonin;

  -  Patients who use immunosuppressive drugs.

Criteria-Related to Magnetic Resonance Imaging (MRI):

  -  Patients presenting a counter-indication to an MRI examination;

  -  Patients whose Inclusion Visit cartilage volume cannot be calculated from the MRI due
     to advanced OA disease;

  -  Patients whose Inclusion Visit cartilage volume cannot be calculated from the MRI due
     to the presence of large fat pads or any other technical reason;

  -  Patients with study knee not entering in the MRI magnet;

  -  Patients with abnormal Inclusion Visit findings and/or any other condition, which, in
     the Investigator's judgment, might increase the risk to the patient or decrease the
     chance of obtaining satisfactory data through MRI to achieve the objectives of the
     study.

The ReBIC-1 study will enroll HF outpatients that fulfill the following criteria:

  1. age equal or greater than 18 year-old;

  2. New York Heart Association functional class I or II;

  3. Left Ventricular Ejection Fraction ≤ 45% by transthoracic two-dimensional
     echocardiography performed within 3 months before the screening visit;

  4. no previous HF related hospitalization or visit to emergency room within 6 months
     before the screening visit;

  5. treatment with a stable dose of furosemide (40 or 80 mg per day) for at least 6 months
     before the screening visit;

  6. plasma potassium < 5 mg/dl within 3 months before the screening visit;

  7. optimal HF treatment with an angiotensin converting enzyme inhibitor (ACEi) or
     angiotensin receptor blocker (ARB) and beta-blockers, unless contraindicated or not
     tolerated.

The ReBIC-1 study will exclude HF outpatients that fulfill the following criteria:

  1. a clinical congestion score (CCS) > 5 points;

  2. prior acute coronary syndrome, stroke or myocardial revascularization within 3 months
     before the screening visit;

  3. any severe valve heart disease (aortic, mitral or tricuspid);

  4. severe pulmonary disease (asthma, emphysema or fibrosis);

  5. severe hepatic failure or cirrhosis;

  6. end-stage acute or chronic renal disease (on hemodialysis);

  7. malignancy on active treatment;

  8. congenital heart disease;

  9. participation on any other interventional clinical research;

 10. inability to understand and sign informed consent.

Inclusion Criteria:

  1. At least one prior episode 2 days or longer in duration during which the subject
     experienced withdrawal symptoms that caused significant incapacitation (e.g.,
     inability to work or do normal activities) OR at least one prior inpatient or
     outpatient medical detoxification during which the subject exhibited withdrawal
     symptoms of sufficient magnitude that sedative-hypnotic or anticonvulsant medication
     was required at least once on 2 consecutive days after cessation of or reduction in
     the use of alcohol following 2 weeks or more of heavy daily consumption

  2. average consumption of 8-30 standard drinks per day for at least 2 weeks prior to
     enrollment in the study;

  3. consenting to participate in the study;

  4. have residency in Trøndelag County after discharge

Exclusion Criteria:

  1. chronic treatment with sedative-hypnotic medications such as benzodiazepines or
     z-hypnotics;

  2. dependence on substances other than alcohol, nicotine or caffeine;

  3. inadequately treated, unstable and/or compromising medical or psychiatric conditions;

  4. low body weight (BMI < 17) or history of anorexia nervosa or bulimia in the past 2
     years;

  5. pregnancy; parturition or breast-feeding in the past 6 months;

  6. inability to read well enough to complete study questionnaires determined by whether
     the prospective subject can read the consent form without help and correctly answer
     basic questions about information in the consent form;

  7. no alcohol in the blood and > 15 h since last intake of alcohol;

  8. prior inclusion and participation in the same study.

Inclusion Criteria:

  1. Patients with oral clopidogrel treatment admitted to hospital within 24 hours or
     long-term follow-up outpatients with oral clopidogrel treatment;

  2. The platelet aggregation rate (PAgR) measured with light transmission aggregometry
     (LTA) is decreased no more than 10% from baseline level, or PAgR is more than 46% and
     the percentage of inhibition of ADP-induced platelet aggregation measured by
     thrombelastogram is not more than 30%;

Exclusion Criteria:

  1. Planned use of glycoprotein IIb/IIIa receptor inhibitors, adenosine diphosphate (ADP)
     receptor antagonists, or anticoagulant therapy during the study period;

  2. Platelet count <100g/L;

  3. Creatinine clearance rate < 30ml/min;

  4. Diagnosed as respiratory or circulatory instability (cardiac shock, severe congestive
     heart failure NYHA II-IV or left ventricular ejection fraction < 40%);

  5. A history of bleeding tendency;

  6. Aspirin, ticagrelor or clopidogrel allergies;

  7. Severe liver injury.

Key Inclusion Criteria:

  -  Provide written informed consent

  -  Active choroidal neovascularization (CNV) lesions secondary to age-related macular
     degeneration (AMD) that affected the central subfield in the study eye at Screening;

  -  Total area of CNV comprising >50% of the total lesion area in the study eye at
     Screening;

  -  Intraretinal and/or subretinal fluid affecting the central subfield of the study eye
     at Screening;

  -  Best Corrected Visual Acuity (BCVA) between 78 and 23 letters, inclusive, in the study
     eye at Screening and Baseline using Early Treatment Diabetic Retinopathy Study (ETDRS)
     testing.

Key Exclusion Criteria:

  -  Any active intraocular or periocular infection or active intraocular inflammation in
     either eye at Baseline;

  -  Central subfield of the study eye affected by fibrosis or geographic atrophy or total
     area of fibrosis >50% of the total lesion in the study eye at Screening;

  -  Subretinal blood affecting the foveal center point and/or >50% of the lesion of the
     study eye at Screening;

  -  Any approved or investigational treatment for neovascular age-related macular
     degeneration (nAMD) in the study eye at any time;

  -  Retinal pigment epithelial rip/tear in the study eye at Screening or Baseline or
     current vitreous hemorrhage or history of vitreous hemorrhage in the study eye within
     4 weeks prior to Baseline;

  -  Pregnant or nursing women; women of child-bearing potential;

  -  Stroke or myocardial infarction in the 90-day period prior to Baseline.
